import axios from 'axios';

axios.defaults.baseURL = "http://localhost:8000";
axios.interceptors.request.use(
    config=>{
        if(config.url.includes("/login") || config.url.includes("/register"))
        return config
    },
    err =>{
        Promise.reject(err)
    }
)

export default axios;
